import React from 'react';
import "./DisplaySubTask.css";

const DisplaySubTask =function(props){


    const createSubTasks=function(item){
      var subTaskName = item.name;
        return <div key={item.key} className = 'Task2'>subTaskName</div>
      }

      var subTaskEntries = props.subTaskEntries;
    var subTaskList = subTaskEntries.map(createSubTasks);

    return(
         <div>
         {subTaskList}
      </div>
    );
}

export default DisplaySubTask;
